// App.js
import React, { useState } from 'react';
import './App.css';

const App = () => {
  const [selectedHolon, setSelectedHolon] = useState(null);

  // Dummy data for the tree structure
  const holons = [
    { id: '1', name: 'Information System', children: [{ id: '2', name: 'Stakeholder' }, { id: '3', name: 'Infrastructure' }] }
  ];

  const selectHolon = (holon) => {
    setSelectedHolon(holon);
  };

  return (
    <div className="app-container">
      <div className="left-panel">
        <div className="process-view">Process View</div>
        <div className="canvas-view">
          Canvas View
          {/* Tree structure will go here */}
        </div>
      </div>
      <div className="right-panel">
        <div className="tools-view">Tools View</div>
        <div className="detail-view">
          Detail View
          {/* Details of the selected holon will be shown here */}
          {selectedHolon ? (
            <>
              <p>Name: {selectedHolon.name}</p>
              {/* Display additional holon details */}
            </>
          ) : (
            <p>No Selection</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default App;
